
const crypt = require("crypto-js")


function h(t) {
            var e = crypt.enc.Hex.parse(t),
                m = crypt.enc.Utf8.parse("0123456789ABCDEF"),
                f=crypt.enc.Utf8.parse("jo8j9wGw%6HbxfFn")
              , n = crypt.enc.Base64.stringify(e)
              , a = crypt.AES.decrypt(n, f, {
                iv: m,
                mode: crypt.mode.CBC,
                padding: crypt.pad.Pkcs7
            })
              , r = a.toString(crypt.enc.Utf8);
            return r.toString()
        }

